"""
2. Отсортируйте по возрастанию методом слияния одномерный вещественный массив,
заданный случайными числами на промежутке [0; 50). Выведите на экран исходный
и отсортированный массивы.

Пример:
Введите число элементов: 5
Исходный - [46.11436617832828, 41.62921998361278, 18.45859540989644, 12.128870723745806, 8.025098788570562]
Отсортированный - [8.025098788570562, 12.128870723745806, 18.45859540989644, 41.62921998361278, 46.11436617832828]
"""

import random
import timeit

def my_merge_sort(input_list_num):
    input_len = len(input_list_num)
    if input_len > 1:
        if input_len % 2 == 1:
            middle_num = input_list_num[input_len // 2]
            left_num = my_merge_sort(input_list_num[:input_len // 2])
            right_num = my_merge_sort(input_list_num[(input_len // 2) + 1:])
        else:
            middle_num = None
            left_num = my_merge_sort(input_list_num[:input_len // 2])
            right_num = my_merge_sort(input_list_num[(input_len // 2):])

        output_list = []

        while True:
            if left_num == [] and right_num == [] and middle_num == None:
                return output_list

            # вставляем среднее число во время слияния + проверка на одинаковые числа
            if middle_num!=None:
                if left_num != [] and right_num != [] and middle_num < left_num[0] and middle_num < right_num[0]:
                    output_list.append(middle_num)
                    middle_num = None
                elif left_num != [] and right_num != [] and middle_num < left_num[0] and middle_num == right_num[0]:
                    output_list.append(middle_num)
                    output_list.append(right_num[0])
                    right_num.pop(0)
                    middle_num = None
                elif left_num != [] and right_num != [] and middle_num == left_num[0] and middle_num < right_num[0]:
                    output_list.append(middle_num)
                    output_list.append(left_num[0])
                    left_num.pop(0)
                    middle_num = None
                elif left_num != [] and right_num != [] and middle_num == left_num[0] and middle_num == right_num[0]:
                    output_list.append(middle_num)
                    output_list.append(left_num[0])
                    output_list.append(right_num[0])
                    right_num.pop(0)
                    left_num.pop(0)
                    middle_num = None
                elif left_num != [] and right_num == [] and middle_num < left_num[0]:
                    output_list.append(middle_num)
                    middle_num = None
                elif left_num != [] and right_num == [] and middle_num == left_num[0]:
                    output_list.append(middle_num)
                    output_list.append(left_num[0])
                    left_num.pop(0)
                    middle_num = None
                elif right_num != [] and left_num == [] and middle_num < right_num[0]:
                    output_list.append(middle_num)
                    middle_num = None
                elif right_num != [] and left_num == [] and middle_num == right_num[0]:
                    output_list.append(middle_num)
                    output_list.append(right_num[0])
                    right_num.pop(0)
                    middle_num = None
                elif right_num == [] and left_num == []:
                    output_list.append(middle_num)
                    return output_list

            # слияние чисел

            if left_num != [] and right_num != []:
                if left_num[0] < right_num[0]:
                    output_list.append(left_num[0])
                    left_num.pop(0)
                elif left_num[0] > right_num[0]:
                    output_list.append(right_num[0])
                    right_num.pop(0)
                else:
                    output_list.append(left_num[0])
                    output_list.append(right_num[0])
                    right_num.pop(0)
                    left_num.pop(0)
            elif left_num != [] and right_num == [] and middle_num == None:
                output_list.extend(left_num)
                return output_list
            elif left_num != [] and right_num == [] and middle_num != None:
                output_list.append(left_num[0])
                left_num.pop(0)

            elif left_num == [] and right_num != [] and middle_num == None:
                output_list.extend(right_num)
                return output_list
            elif left_num == [] and right_num != [] and middle_num != None:
                output_list.append(right_num[0])
                right_num.pop(0)

    else:
        return input_list_num




def tester(test_list, timer_bool = False, numtry = 0):

    sorted_test = sorted(test_list)
    output = my_merge_sort(test_list)
    print(f'\nis_good = {sorted_test == output}')
    print(f'Изначальный список:   {test_list}')
    print(f'Встроенная сортировка {sorted_test}')
    print(f'my_merge_sort         {output}')
    if timer_bool == True:
        print(f'numtry == {numtry} /// result == {timeit.timeit(stmt="my_merge_sort" + f"({test_list})", setup=f"from __main__ import my_merge_sort", number=numtry, globals=globals())}')






for i in range(5):
    test_list = [random.uniform(0, 50) for el in range(100)]
    random.shuffle(test_list)
    tester(test_list, True, 1000)



